/**
 * Type declarations for Hugeicons PRO
 *
 * The package doesn't ship with TypeScript declarations,
 * so we declare them here as any type.
 */

declare module '@hugeicons-pro/core-stroke-rounded/*' {
  const icon: any
  export default icon
}

declare module '@hugeicons-pro/core-solid-rounded/*' {
  const icon: any
  export default icon
}

declare module '@hugeicons-pro/core-bulk-rounded/*' {
  const icon: any
  export default icon
}

declare module '@hugeicons-pro/core-duotone-rounded/*' {
  const icon: any
  export default icon
}

declare module '@hugeicons-pro/core-twotone-rounded/*' {
  const icon: any
  export default icon
}

declare module '@hugeicons-pro/core-solid-standard/*' {
  const icon: any
  export default icon
}
